import React from 'react';
import "./Navbar.css";

function Navbar() {
  return (
    <div className="navbar navbar-expand-lg navbar-dark ftco_navbar bg-dark ftco-navbar-light site-navbar-target" id='ftco-navbar'>
      <div className='container'>
        <a className="navbar-brand" href="index.html">Ted <sup>X</sup><span>mace</span></a>
      </div>
              
    </div>
  )
}

export default Navbar
